package com.market.pos.sqlPojo;import javax.persistence.*;@Entity@Table(name = "users")public class UsersCreate {    @Id    private Integer userid;    private String username;    private String grade;    private String update_time;    public Integer getUserid() {        return userid;    }    public void setUserid(Integer userid) {        this.userid = userid;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getGrade() {        return grade;    }    public void setGrade(String grade) {        this.grade = grade;    }    public String getUpdate_time() {        return update_time;    }    public void setUpdate_time(String update_time) {        this.update_time = update_time;    }}